import React from 'react';
import FilterButtons from '../filter-buttons';

import './header.css';

const Header = () => {
  return (
    <div className="header">
      <h3 className='header-logo'>
        <a href="/">
          Moscow Flights Schedule
        </a>
      </h3>

      <FilterButtons />
    </div>
  );
};

export default Header;
